import React, { useEffect, useState } from 'react';
import './App.css';
function App() {
  const [search,setSerch]=useState('');
useEffect(()=>{
  setTimeout(()=>{
    setSerch(
      ['tooth paste','tooth brush','denal floss','mouth guard']
    )
  },2000)
},[])
  return (
    <div className='App'>
    
     <ul>
      {search.map((prod)=><li>{prod}</li>)}
     </ul>
    </div>
  )
}
export default App
